INSERT INTO `recipesteps` (`RecipeId`, `StepOrder`, `StepDescription`, `StepImage`) VALUES
(6, 1, '準備食材：雞蛋3個、菠菜1把洗淨、番茄1個切丁、火腿2片切小塊、全麥吐司2片、牛奶100毫升、奶油1湯匙、鹽和黑胡椒適量。', 'uploads/test.png'),
(6, 2, '熱鍋加入奶油，小火融化後放入菠菜炒軟，約3分鐘，盛出備用。', 'uploads/test.png'),
(6, 3, '同一鍋中加入火腿塊，炒至微焦，約2分鐘，加入番茄丁炒1分鐘。', 'uploads/test.png'),
(6, 4, '將雞蛋打入碗中，加入牛奶、少許鹽和黑胡椒，攪拌均勻。', 'uploads/test.png'),
(6, 5, '將蛋液倒入鍋中，加入炒好的菠菜，小火慢炒至蛋液凝固，約5分鐘。', 'uploads/test.png'),
(6, 6, '同時用烤箱或平底鍋將全麥吐司烤至金黃，約5分鐘。', 'uploads/test.png'),
(6, 7, '將炒蛋放在吐司上，撒上少許黑胡椒，搭配一杯溫牛奶即可享用，總計約45分鐘。', 'uploads/test.png'),
(22, 1, '雞腿肉切塊後，拌入麵粉（25 克）、咖哩粉（15 克）、鹽和胡椒粉，靜置醃 10 分鐘', ''),
(22, 2, '馬鈴薯、紅蘿蔔、洋蔥切塊；蘋果、薑、蒜頭磨成泥；紅辣椒去籽後切末（如使用）。', ''),
(22, 3, '鍋中加沙拉油（15 毫升），中火將雞肉煎至微焦後取出備用。', ''),
(22, 4, '同鍋加入洋蔥、蒜泥、薑泥與紅辣椒炒至洋蔥變透明。', ''),
(22, 5, '加入馬鈴薯、紅蘿蔔、番茄罐頭（200 毫升）、水（400 毫升）、雞湯塊煮滾。', ''),
(22, 6, '蓋鍋燉煮約 20 分鐘至蔬菜熟軟。', ''),
(22, 7, '加入剩餘咖哩粉（15 克）、蘋果泥、奶油（30 克），略煮至湯汁濃稠。', ''),
(22, 8, '白飯舖底，淋上咖哩即可享用。', ''),
(23, 1, '洋蔥切絲，馬鈴薯與紅蘿蔔切小塊。', ''),
(23, 2, '鍋中加 15 毫升沙拉油，炒香洋蔥至變軟。', ''),
(23, 3, '加入馬鈴薯與紅蘿蔔翻炒 2 分鐘。', ''),
(23, 4, '加入 300 毫升水，煮沸後轉中小火煮 10 分鐘。', ''),
(23, 5, '將咖哩塊加入，攪拌至完全溶化，再煮 5 分鐘使醬汁濃稠。', ''),
(23, 6, '里肌肉片兩面灑上鹽與胡椒', ''),
(23, 7, '依序裹上麵粉 → 蛋液（打散的蛋）→ 麵包粉。', ''),
(23, 8, '鍋中倒入約 500 毫升油，熱至約 170°C。', ''),
(23, 9, '下豬排炸約 3～4 分鐘/面，炸至金黃色，撈起瀝油，靜置 2 分鐘後切片。', ''),
(23, 10, '白飯舖底，放上豬排，淋上咖哩即可享用。', ''),
(24, 1, '雞胸肉切小丁，洋蔥切末。', NULL),
(24, 2, '熱鍋後炒雞肉至變白，加入洋蔥拌炒至透明。', NULL),
(24, 3, '加入玉米粒與白飯（此處不列），翻炒均勻。', NULL),
(24, 4, '加入番茄醬、醬油與黑胡椒，繼續翻炒至收汁，盛出備用。', NULL),
(24, 5, '雞蛋打入碗中，加入鮮奶與鹽，攪拌均勻。', NULL),
(24, 6, '平底鍋加熱後倒入一半蛋液，小火煎成圓形薄蛋皮，略熟但仍柔軟即可。', NULL),
(24, 7, '將炒飯置於蛋皮中央，對折包住，輕輕將蛋包移至盤中，輕壓定型。', NULL),
(25, 1, '蝦仁去腸泥後洗淨瀝乾，洋蔥切丁，青蔥切末，雞蛋打散備用。', NULL),
(25, 2, '熱鍋後將蛋液炒至半熟，盛起備用。', NULL),
(25, 3, '同鍋炒洋蔥至透明，加入蝦仁炒至轉紅。', NULL),
(25, 4, '加入白飯炒散，再加入炒蛋混合均勻。', NULL),
(25, 5, '加入醬油、鹽與黑胡椒調味。', NULL),
(25, 6, '最後撒入青蔥快炒數秒，即可盛盤。', NULL),
(26, 1, '牛肉片切短段，洋蔥、高麗菜、紅蘿蔔切絲，青蔥切段，蒜頭切末備用。', NULL),
(26, 2, '熱鍋後下牛肉片快炒至半熟，撈出備用。', NULL),
(26, 3, '原鍋炒洋蔥、紅蘿蔔與高麗菜至微軟。', NULL),
(26, 4, '加入蒜末與青蔥炒香，再放回牛肉。', NULL),
(26, 5, '淋入醬油與味醂，加黑胡椒，大火快炒約 1 分鐘讓醬汁收乾。', NULL),
(26, 6, '盛盤後可搭配白飯食用。', NULL),
(27, 1, '將高麗菜、紅蘿蔔、洋蔥切絲，豬肉片切小段。', NULL),
(27, 2, '熱鍋炒豬肉片至變色，加入洋蔥炒香。', NULL),
(27, 3, '加入紅蘿蔔和高麗菜拌炒至稍軟。', NULL),
(27, 4, '放入麵條翻炒均勻。', NULL),
(27, 5, '加入醬油、味醂、胡椒粉調味，拌炒至收汁即可。', NULL),
(28, 1, '將雞蛋打入碗中，加入砂糖、醬油、味醂與高湯，攪拌均勻。', NULL),
(28, 2, '平底鍋加熱並抹上一層油，倒入一層薄蛋液，稍微凝固時從一端開始捲起。', NULL),
(28, 3, '將蛋捲推到鍋邊，再倒入蛋液讓它接續在蛋捲旁邊。', NULL),
(28, 4, '重複上述動作，直到蛋液用完並捲成玉子燒。', NULL),
(28, 5, '稍微放涼後切片即可。', NULL),
(29, 1, '將消化餅乾壓碎，與無鹽奶油（40克）混合，鋪在烤模底部壓實，放入冰箱冷藏備用。', NULL),
(29, 2, '奶油乳酪放室溫回軟，加入砂糖（80克）攪拌至滑順無顆粒。', NULL),
(29, 3, '依序加入雞蛋、鮮奶油、低筋麵粉（20克）、檸檬汁（10毫升），攪拌均勻成蛋糕糊。', NULL),
(29, 4, '將蛋糕糊倒入冷藏後的模具中，震出氣泡。', NULL),
(29, 5, '放入預熱至 160°C 的烤箱中烘烤約 50 分鐘，表面上色後可關火悶烤 10 分鐘。', NULL),
(29, 6, '烤好後取出放涼，冷藏至少 4 小時以上再切片食用風味更佳。', NULL),
(30, 1, '洋蔥切絲，牛肉切段（若已為薄片可省略處理）。', NULL),
(30, 2, '在鍋中加入高湯、醬油、味醂、清酒與砂糖，加熱至砂糖完全溶解。', NULL),
(30, 3, '加入洋蔥煮至透明柔軟。', NULL),
(30, 4, '加入牛肉煮熟，撈除浮沫，煮至湯汁略收。', NULL),
(30, 5, '盛入熱白飯上，可加上一顆生蛋或溫泉蛋，依喜好撒上蔥花或七味粉。', NULL),
(31, 1, '將雞肉放入鍋中，加入橄欖油（45 克）、白酒（250 毫升）、香菜（4 枝）、切碎的大蒜（3 個）、鹽（2 克）、黑胡椒、奧勒岡、孜然、百里香（共約 4 克）與檸檬汁（50 毫升）。', NULL),
(31, 2, '混合均勻後，放入預熱至 180°C 的烤箱中，烘烤約 1 小時，直到雞肉熟透。', NULL),
(31, 3, '最後轉成上火烘烤（Broil），再烤約 5 分鐘，讓表皮上色酥脆。', NULL),
(31, 4, '完成後取出，稍微冷卻後即可享用。可搭配蒸豆、熟蔬菜等一同食用。', NULL),
(32, 1, '把小麥放到合成台上', NULL),
(32, 2, '吃掉他', NULL),
(33, 1, '12', NULL);
